import React, { Fragment, Component } from 'react';
import './App.css';
import Main from './Components/Main';
import Footer from './Components/Footer/Footer';

class App extends Component {
  render() {
    return (
      <Fragment>
        <Main />
        <Footer />
      </Fragment>
    );
  }
}

export default App;
